import "./card.css"

const Card = ({source}) => {

    return (
        <div className="card--container">
            <img src={source} alt="nft"/>
            <div>Liquid Wave</div>
            <div></div>
            <div></div>
            <button />
        </div>
    )
}

export default Card;
